条件に困難が多く、一般的な商用電力によるヒーティング方式とした。電気料金の経済性を考慮。下り車線の施設に同じものを採用し、融雪状況の差異がないようにするため、本施設を設置した。', null, 2, 2, 2, 2, 2, 2, 2, 2, 2, False, False, '車22,23,376,歩9', null, '降雪検知器（赤外線式）M-SD-S300常時、降雪有り検知。受雪板の塗装の劣化　　図面なし', '面積当たりの使用実績(kwh)が多い。面積当たりの請求額が高い。面積当たりのＷ数が高い。', 'Ｓ４３歩道部　250w/m2 改良して非優先を入れると契約電力を減できる', '深川１，２、３、番号なし', 5, 13, null);
